    <a className="nav-link text-dark">Register</a>
    </Link>
    </li>
</ul>
    );

return (

<React.Fragment>
  {head()} {nav()} <div className="container pt-5 pb-5">{children}</div>
</React.Fragment>

    );  
};

export default Layout;
